	);

	//
	return (
		<div className="pt-5">
			<Routes>
				<Route exact path="/" element={<Home />} />
				<Route
					exact
					path="/login"
					element={<LoginForm login={login} />}
				/>
				<Route
					exact
					path="/signup"
					element={<SignupForm signup={signup} />}
				/>
				<Route
					exact
					path="/companies"
					element={
						<PrivateRoute>
							<CompanyList />
						</PrivateRoute>
					}
				/>
				<Route
					exact
					path="/jobs"
					element={
						<PrivateRoute>
							<JobList />
						</PrivateRoute>
					}
				/>
				<Route
					exact
					path="/companies/:handle"
					element={
						<PrivateRoute>
							<CompanyDetail />
						</PrivateRoute>
					}
				/>
				<Route
					exact
					path="/profile"
					element={
						<PrivateRoute>
							<Profile />
						</PrivateRoute>
					}
				/>
			</Routes>
		</div>
	);
}

export default Paths;
